package com.abhinash.userrating.domain;import javax.persistence.Entity;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;@Entitypublic class Rating {    @Id    @GeneratedValue(strategy = GenerationType.AUTO)    private Long id;    private String userId;    private Long movieId;    private int rating;    public Rating(Long movieId, int rating) {        this.movieId = movieId;        this.rating = rating;    }    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public String getUserId() {        return userId;    }    public void setUserId(String userId) {        this.userId = userId;    }    public Long getMovieId() {        return movieId;    }    public void setMovieId(Long movieId) {        this.movieId = movieId;    }    public int getRating() {        return rating;    }    public void setRating(int rating) {        this.rating = rating;    }}